import 'package:json_annotation/json_annotation.dart';part 'time_price_dto.g.dart';@JsonSerializable(ignoreUnannotated: false)class TimePriceDto {  @JsonKey(name: 'id')  final int? id;  @JsonKey(name: 'name')  final String? name;  TimePriceDto({this.id, this.name});  factory TimePriceDto.fromJson(Map<String, dynamic> json) => _$TimePriceDtoFromJson(json);  Map<String, dynamic> toJson() => _$TimePriceDtoToJson(this);}